class Solution(object):
    def maxProduct(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        largest = max(nums)
        for i in range(nums.count(1)):
            nums.remove(1)
        tmp = nums[1:]
        while len(tmp)>0:
            for j in range(0, len(tmp)):
                product = tmp[j]*nums[j]
                tmp[j] = product
                if product > largest:
                    largest = product
                
            print(tmp)
            tmp = tmp[1:]

        return largest

